import { Link } from 'react-router-dom';
const Homepage = () => {
  return (
      <div>
        {/* Barre de navigation */}
        <nav>
          <ul>
            <li>
              <Link to="/">Accueil</Link>
            </li>
            <li>
              <Link to="/about">Ã€ propos</Link>
            </li>
            <li>
              <Link to="/contact">Contact</Link>
            </li>
          </ul>
        </nav>

        {/* Contenu de la page */}

          {/* Route pour la page d'accueil */}
          <Route exact path="/">
            <Homepage />
          </Route>

      </div>

  );
};

export default Homepage;
